package primitives_test

import (
	"encoding/hex"
	"github.com/olympus-protocol/ogen/pkg/primitives"
	testdata "github.com/olympus-protocol/ogen/test"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestBlock(t *testing.T) {
	correct := testdata.FuzzBlock(2, true, true)
	for _, b := range correct {
		ser, err := b.Marshal()
		assert.NoError(t, err)

		desc := new(primitives.Block)
		err = desc.Unmarshal(ser)
		assert.NoError(t, err)

		assert.Equal(t, b, desc)
	}

	incorrect := testdata.FuzzBlock(2, false, true)
	for _, b := range incorrect {
		_, err := b.Marshal()
		assert.NotNil(t, err)

	}

	nilpointers := testdata.FuzzBlock(2, true, false)
	for _, b := range nilpointers {
		assert.NotPanics(t, func() {
			data, err := b.Marshal()
			assert.NoError(t, err)

			n := new(primitives.Block)
			err = n.Unmarshal(data)
			assert.NoError(t, err)

			assert.Equal(t, b, n)

			assert.Equal(t, uint64(0), n.Header.Slot)
		})

	}
}

func TestBlocksMerkle(t *testing.T) {
	// Serialized snappy compressed block
	blockRaw, err := hex.DecodeString("")

	assert.NoError(t, err)

	b := new(primitives.Block)
	err = b.Unmarshal(blockRaw)
	assert.NoError(t, err)

	assert.Equal(t, "3bb1bdf866084fd29a8a0b79e225e090ffed6ba1c32acb464fcbbdfe7ac7a249", b.VotesMerkleRoot().String())
	assert.Equal(t, "ae2a2f8841955d2a3fe53cec5a45e9e1c79744838a5e6a3aa4a63e6984a65432", b.TransactionMerkleRoot().String())
	assert.Equal(t, "e87430b96988c446a845fbc7007ad7fd6df6054c48849f211451c0f3db87107a", b.TransactionMultiMerkleRoot().String())
	assert.Equal(t, "4926754741899891ee77b3d724561044101d50fe2beff273d0111ca4e975fdcc", b.DepositMerkleRoot().String())
	assert.Equal(t, "e21f9e61de78686d01a0275b8560006fb18f33cddd7871cc7a03ea97a9dd0743", b.ExitMerkleRoot().String())
	assert.Equal(t, "a52e6266fffa439b5d8319662312f9bcd3adfc92f18fa1c9c1d234ada2f03d94", b.VoteSlashingRoot().String())
	assert.Equal(t, "b43483e75b6f8f2074e64b0cde6fceedf91d4485b2aa5f2fb830532c4724a0a9", b.RANDAOSlashingsRoot().String())
	assert.Equal(t, "d3ce2476ad2633b55ec3f315be2b54c0eec6e72ce4ae2bd2db3774767bbbd26b", b.ProposerSlashingsRoot().String())
	assert.Equal(t, "ee6ebfbace55a75d4448f72a3cc4fef81a531cdd655cce17f75f7dd768b80445", b.GovernanceVoteMerkleRoot().String())

	expectedTx := []string{"559a8809661810f2f819000ec0efb019ddbc571b9504662aacf9f1014b194a54", "fb3f9a4f4d581758af5ce83420841981639ab8b531cde1551f007a05e01a1de3"}
	txs := b.GetTxs()

	assert.Equal(t, expectedTx, txs)
}
